def add_numbers(x, y):
    '''Adds two numbers together.'''
    return x + y

def multiply_by_two(x):
    '''Multiplies a number by two.'''
    return x * 2

def create_and_greet(name):
    '''Creates an instance of BaseClass and returns its greeting.'''
    obj = BaseClass(name)
    return obj.greet()
